// Fonction pour obtenir un nombre aléatoire
export const getRandomSoussouNumber = () => {
  const randomIndex = Math.floor(Math.random() * completeSoussouNumbers.length);
  return completeSoussouNumbers[randomIndex];
};

// Fonction pour obtenir plusieurs nombres aléatoires
export const getRandomSoussouNumbers = (count = 5) => {
  const shuffled = [...completeSoussouNumbers].sort(() => 0.5 - Math.random());
  return shuffled.slice(0, count);
};

// Fonction pour trouver un nombre par sa valeur
export const findSoussouNumber = (number) => {
  return completeSoussouNumbers.find(item => item.number === number);
};

// Fonction pour trouver un nombre par sa traduction Soussou
export const findNumberBySoussou = (soussouText) => {
  return completeSoussouNumbers.find(item => 
    item.soussou.toLowerCase() === soussouText.toLowerCase() ||
    item.translation.toLowerCase() === soussouText.toLowerCase()
  );
};

// Fonction pour obtenir des nombres par niveau de difficulté
export const getNumbersByDifficulty = (difficulty) => {
  switch (difficulty) {
    case 'easy':
      return completeSoussouNumbers.filter(item => item.number <= 20);
    case 'medium':
      return completeSoussouNumbers.filter(item => item.number <= 100);
    case 'hard':
      return completeSoussouNumbers.filter(item => item.number <= 1000);
    case 'expert':
      return completeSoussouNumbers;
    default:
      return completeSoussouNumbers.filter(item => item.number <= 20);
  }
};

export default completeSoussouNumbers;
